import React from 'react';
import { Box, Link, Typography, useTheme } from '@mui/material';

const Navbar = () => {
  const theme = useTheme();
  return (
    <Box
      width="100%"
      backgroundColor={theme.palette.background.alt}
      p="1rem 6%"
      display="flex"
      alignItems="center"
      justifyContent="space-between"
      textAlign="center"
      sx={{ boxShadow: 3, mb: 2 }}
      minHeight="64px"
    >
      <Box>
        <img src="client\logo.svg" alt="Logo" height={40} />
      </Box>
      <Box sx={{ margin: '0 auto' }}>
        
        <Typography variant="h1" color="primary" fontWeight="bold" style={{ fontFamily: 'Space Grotesk' }}>
          MyGPT
        </Typography>
      </Box>

      <Box>
        <Link href="/login" p={1} sx={{ border: '2px solid', borderRadius: '30px', padding: '8px 16px', marginRight: '10px' }}>
          Login
        </Link>
        <Link href="/register" p={1} sx={{ border: '2px solid', borderRadius: '30px', padding: '8px 16px' }}>
          Sign Up
        </Link>
      </Box>
    </Box>
  );
};

export default Navbar;
